import './App.css';
import Header from './components/header/header';
import Main from './components/main/main';
import Footer from './components/footer/footer';

function App() {
  let snss = [
    {img: './i-instagram.svg'},
    {img: './i-facebook.svg'},
    {img: './i-youtube.svg'},
    {img: './i-bog.svg'},
  ]
  let infos=['회사소개','인재채용','이용약관','개인정보처리방침','위치정보 이용약관','차량손해면책제도','고객센터','제휴문의']
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer snss={snss}  infos={infos}/>
    </div>
  );
}

export default App;
